function leapyears(): void {
    for (let i: number = 1900; i <= 2020; i++) {
        if (i % 400 == 0) {
            console.log(i);
        }
        if (i % 4 == 0) {
            if (i % 100 != 0) {
                console.log(i);
            }
        }
    }
}
